import react from "react";
import styled from "styled-components"
import logo from "../img/logo.png"

const HeaderBox = styled.header`
float: left;

`


const Header = () => {
    return (
            
            <HeaderBox>
                <img src={logo}/> 
                <p>HEADER</p>
                
            </HeaderBox>
        
    )
}

export default Header;
